YouTube Full Movie..
https://youtu.be/1LiqpPujeEo

Story..
2020년 8월 31일 오후 3시. 길을 걷다가 우연히 "작은아이루"를 만났어요. 만삭의 몸이였던 작은아이루가 1주일전부터 보이질 않아서 사실 걱정하고 있었거든요. 홀쭉해진 몸으로 나타나 반겁게 나를 맞이해주며 따라오라고 했어요. 이번이 두번째 출산으로 지난번 아가들은 모두 잃어버려서 걱정이 됬어요. 

작은아이루를 따라서 길옆 풀숲으로 가자 흰둥이 2마리와 젖소 1마리가 엄마를 찾고 있었어요. 특히 흰둥이는 최근 5년 동안 태어난 적이 없었던, 이곳에서는 매우 희귀한 고양이예요. "장하다 작은아이루야. 저녁때 맛있는거 사줄께". "아가들아. 길냥이로 산다는 것이 거칠고 힘들겠지만, 부디 건강하고 행복하게 잘살렴".

August 31, 2020 at 3pm. While walking on the street, I ran into Iru Jr by chance. Iru Jr, who was about to give birth, was not visible from a week ago, so I was actually worried. She appeared with her slim body, greeted me happily, and told me to follow her. I was worried because she lost all of her last babies this time as her second childbirth. 

As I followed Iru Jr to the grass by the side of the road, two white and one cow were looking for their mother. The white cat in particular is a very rare cat here, which has never been born in the last 5 years. "Good job Iru Jr. I'll buy you something delicious for dinner". "Iru Jr's babies, living as a stray cat maybe rough and hard but please be healthy and happy".

